import React from 'react';
import { makeStyles, TextareaAutosize } from '@material-ui/core';

const useStyles = makeStyles((theme) => ({
  root: {
    margin: 'auto',
  },
}))

const Home = () => {
  const classes = useStyles();
  return (
    <div className={classes.root}>
      Home Page
    </div>
  )
}

export default Home;
